import React from 'react';
import styled from 'styled-components';
import InputAndSubmit from './InputAndSubmit';

const StyledSplashPage = styled.div`
  position: relative;
  div {
    text-align: center;
    position: absolute;
    top: 40%;
    color: black;
    font-size: 2em;
  }
`

const SplashPage = () => {
  return (
    <StyledSplashPage>
      <div>
        Create or Join a Room to Get Started
      </div>
    </StyledSplashPage>
  )
}

export default SplashPage;
